import {FaShoppingCart} from "react-icons/fa";


const Navbar = () => {
  return (
    <div>
      <div className="flex justify-between">
        <img alt="" src=""/>

        <div>
          <p>Home</p>
          <FaShoppingCart/>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
